-- ----------------------------
--  Table structure for `ag_pic_tag`
-- ----------------------------
DROP TABLE IF EXISTS `ag_pic_tag`;
CREATE TABLE `ag_pic_tag` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pic_id` bigint(20) unsigned NOT NULL,
  `name` varchar(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
--  Table structure for `ag_user`
-- ----------------------------
DROP TABLE IF EXISTS `ag_user`;
CREATE TABLE `ag_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `nickname` varchar(10) NOT NULL,
  `avatar` varchar(50) NOT NULL DEFAULT '/rescoures/pic/avatar/default.jpg',
  `sex` char(1) NOT NULL,
  `email` varchar(20) NOT NULL,
  `qq` varchar(15) NOT NULL DEFAULT '0',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `user_type` tinyint(4) unsigned NOT NULL DEFAULT '3' COMMENT '1管理员2游客3普通会员4vip',
  `activeness` int(10) unsigned NOT NULL DEFAULT '0',
  `favor_num` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4;

